import React, { Component } from 'react';
import { View, StyleSheet, Image, Text, Button, TouchableOpacity, TextInput } from 'react-native'
import { useRoute } from '@react-navigation/native';

export default function LocationForm({ navigation }) {
    const route = useRoute();

    return (
        <View style={styles.container}>

            <Text>Pick Your Location</Text>
        </View>
    )
}

const styles = StyleSheet.create({
    container: {
        borderRadius: 30,
        // Left: 21,
        backgroundColor: '#212027'
    },

    border: {
        width: 28.5,
        borderBottomWidth: 3,
        borderColor: '#FFFFFF',
        alignSelf: 'center',
        marginTop: 12,
        borderRadius: 1
    },

    img: {
        width: 179.97,
        height: 158.58,
        marginTop: 88,
        marginLeft: 115,
        marginRight: 93.68,
        marginBottom:28.62,
    },

    text: {
        width: 306,
        marginLeft: 42,
        alignSelf: 'center',
        // alignItems: 'stretch',
        fontWeight: 500,
        fontSize: 20,
        lineHeight: 26,
        textAlign: 'justify-content',
        color: '#FFFFFF',
        marginBottom: 33,
    },

    button: {
        backgroundColor: '#FF7C24',
        borderRadius: 12,
        paddingBottom: 19,
        paddingTop: 18,
        marginBottom: 12,
        fontSize: 18,
        fontWeight: 600,
        color: '#FFFFFF',
        textAlign: 'center',
    },

    back_button: {
        fontSize: 18,
        color: "rgba(255,255,255,0.35)",
        textAlign: 'center',
    }
})
